import React from "react";

const MapView = ({ data }) => {
    return (
      <div>
          <table>
        <thead>
          <tr>
              <th>S.No</th>
              <th>Bundesnetza gentur Number</th>
              <th>Company</th>
              <th>Type</th>
              <th>State</th>
              <th>Production Value (kW)</th>
              <th>Agg.Production (kW)</th>
          </tr>
        </thead>

        <tbody>
        {data.map((row, i)=>(
             <div className="col s12 m6 l6 card horizontal box" key={i}>
                 {row.name}
             </div>
          ))} 

        </tbody>
      </table>  
      </div>
    );
  };

  export default MapView;
